script: |
  super -f text -I q869.spq | sort > q869.out

inputs:
  - name: q869.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE (e>a AND e<b)
      AND d NOT BETWEEN 110 AND 150
      ORDER BY 1;
  - name: t1

outputs:
  - name: q869.out
    data: |
      190
      222
      248
